import React, { useState, useEffect } from "react";

const HomePage = () => {
    const [timer, setTimer] = useState(new Date.now());
    useEffect(() => {
        setInterval(() => {
            setTimer(new Date.now());
        }, 1000);
    }, [setTimer]);

    return (
        <div>
            {timer}
            <h1>Welcome to Redux</h1>
        </div>
    );
};

export default HomePage;
